import React from 'react';
import email1 from '../../assets/email1.png';
import email2 from '../../assets/email2.png';
import email3 from '../../assets/email3.png';
import email4 from '../../assets/email4.png';
import email5 from '../../assets/email5.png';
import emailThumbnail from '../../assets/emailthumbnail.jpg';

const emailTileData = [
    {
        img: email1,
        title: 'email1',
        author: 'author',
        cols: 3
    },
    {
        img: email2,
        title: 'email2',
        author: 'author',
        cols: 3
    },
    {
        img: email3,
        title: 'email3',
        author: 'author',
        cols: 6
    },
    {
        img: email4,
        title: 'email4',
        author: 'author',
        cols: 3
    },
    {
        img: email5,
        title: 'email5',
        author: 'author',
        cols: 3
    },
    {
        img: emailThumbnail,
        title: 'thumbnail',
        author: 'author',
        cols: 6
    }

];

export default emailTileData;
